-- Create the Restaurant table
CREATE TABLE restaurant (
    resto_id INT AUTO_INCREMENT PRIMARY KEY,
    resto_name VARCHAR(255) NOT NULL,
    resto_desc TEXT,
    address VARCHAR(255) NOT NULL,
    rating FLOAT NOT NULL DEFAULT 0,
    img_path VARCHAR(255),
    vid_path VARCHAR(255),
    category ENUM('Indonesian', 'Western', 'Italian', 'Chinese', 'Japanese', 'Korean', 'Thai', 'Indian', 'Other')
);

-- Create the Food table
CREATE TABLE food (
    food_id INT AUTO_INCREMENT PRIMARY KEY,
    food_name VARCHAR(255) NOT NULL,
    food_desc TEXT,
    price INT NOT NULL,
    img_path VARCHAR(255),
    resto_id INT,
    FOREIGN KEY (resto_id) REFERENCES restaurant (resto_id)
);

-- Create the Schedule table
CREATE TABLE schedule (
    resto_id INT,
    `day` ENUM('Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'),
    open_time TIME,
    close_time TIME,
    FOREIGN KEY (resto_id) REFERENCES restaurant (resto_id)
);

-- Create the User table
CREATE TABLE user (
    email VARCHAR(255) PRIMARY KEY,
    user_name VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
    isAdmin BOOLEAN DEFAULT 0,
    profile_img VARCHAR(255) DEFAULT 'profile-img.png',
    isSubs BOOLEAN DEFAULT 0,

    CHECK(NOT (isAdmin = 1 AND isSubs = 1))
);

